; /* Start:"a:4:{s:4:"full";s:72:"/js/vendor/factory/factory.forms.js?14984932742777";s:6:"source";s:57:"/js/vendor/factory/factory.forms.js";s:3:"min";s:0:"";s:3:"map";s:0:"";}"*/
$(function(){
    $('.js-form').each(function(){
        var $form = $(this).ajaxForm({
                beforeSubmit : function(fields){
                    $.each(fields, function(i, field){
                        if(field.name == 'confirm'){
                            field.value = 0;
                        }
                    });
                    $form.addClass('loading');
                },
                success : function(response){
                    $form.removeClass('loading');
                    if(response.ok == '1'){
                        $form.addClass('form-complete');
                        var onsuccess = $form.attr('data-onsuccess');
                        if(onsuccess && onsuccess.length){
                            eval(onsuccess);
                        }
                        $form.find('input[type=text], textarea').val('');
                    }
                    else{
                        $form.addClass('error');
                        if(response.fields && response.fields.length){
                            $.each(response.fields, function(i, field){
                                $form.find('[name=' + field.name + ']').addClass('error');
                            });
                        }
                    }
                    captcha.update();
                }
            }),
            captcha = {
                ok : false,
                _init : function(){
                    var self = this;
                    this.e = {
                        image : $form.find('.js-captcha-image'),
                        text : $form.find('.js-captcha-text'),
                        code : $form.find('.js-captcha-code')
                    };
                    if(!this.e.text.length || !this.e.image.length || !this.e.code.length){
                        return;
                    }
                    this.ok = true;
                    this.e.image.click(function(){
                        self.update();
                    })
                },
                update : function(){
                    if(!this.ok){
                        return;
                    }
                    var self = this;
                    $.post('/ajax.php', {
                        'get_captcha' : '1'
                    }, function(id){
                        self.e.text.val('');
                        self.e.image.attr('src', '/bitrix/tools/captcha.php?captcha_sid=' + id);
                        self.e.code.val(id);
                    });
                }
            },
            onchange = function(){
                $(this).removeClass('error');
            };

        captcha._init();

        $form.find('input, textarea').change(onchange).keyup(onchange);
    });
})
/* End */
;
; /* Start:"a:4:{s:4:"full";s:73:"/js/vendor/factory/factory.global.js?14984932741560";s:6:"source";s:58:"/js/vendor/factory/factory.global.js";s:3:"min";s:0:"";s:3:"map";s:0:"";}"*/
$(function(){
    if($('.fancybox').length > 0)
        $('.fancybox').fancybox();

    $('.ajax-form-send, [action="/ajax/"]').each(function(){
    	var $form = $(this),
    		error = new function(){
    			var me = this,
    				inited = false,
		    		$elements = $form.find('[name]'),
    				CSS_CLASS = 'ajax-form-error';

    			$.extend(this, {
    				show : function(text){
    					if(!text){
    						return me;
    					}
		    			alert('Ошибка: ' + text);
		    			return me;
    				},
    				highlight : function(names){
    					if(!names || !names.length){
    						return me;
    					}
    					me.init();
	    				$.each(names, function(i, name){
	    					$elements.filter('[name="' + name + '"]').addClass(CSS_CLASS);
	    				});
	    				return me;
    				},
    				init : function(){
    					if(inited){
    						return me;
    					}

    					inited = true;

    					function callback(){
			    			$(this).removeClass(CSS_CLASS);
			    		}

    					$elements
    						.keyup(callback)
    						.change(callback);

    					return me;
    				}
    			});
    		};

    	$form.ajaxForm({
	    	success : function(response){
	    		console.log(response);
	    		if(response.error){
	    			error
	    				.show(response.info)
	    				.highlight(response.names);
	    			return;
	    		}

	    		if(response.info){
	    			alert(response.info);
	    		}
	    	}
	    });


    });
});


function plural(n, forms) {
    return forms[n%10==1 && n%100!=11 ? 0 : n%10>=2 && n%10<=4 && (n%100<10 || n%100>=20) ? 1 : 2];
}
