function startPreventBodyScroll(){
	$('body').addClass('is-fixed');
	if($(window).width() < 768){
		$('body').css({'position': 'fixed', width: $('body').width() + 'px'});
	}

}
function endPreventBodyScroll(){
	$('body').removeClass('is-fixed');
	if($(window).width() < 768){
		$('body').css({'position': 'static', 'width': 'auto'});
	}
}

